import React from "react";
import "/style.css";

const Card = ({ title, children }) => {
  return (
    <div className="card mt-4">
      <div className="card-header">
        <h3>
          <strong>
            {title}
          </strong>
        </h3>
      </div>
      <div className="card-body">{children}</div>
    </div>
  );
}

export default Card;
